import React from 'react';
import logo from './logo.svg';
import './App.css';
import MissionRow from './MissionRow';
import ImperialTracker from './ImperialTracker';
import { unstable_renderSubtreeIntoContainer } from 'react-dom';

const rce = React.createElement;

function App() {
  return rce('div', {className: 'App'},
    rce(MissionRow, {missionType: 'Introduction', threatLevel: 2, itemTiers: 1}),
    rce(MissionRow, {missionType: 'Side Mission', threatLevel: 3, itemTiers: [1, 2]}),
    rce(ImperialTracker, {
        xp: 1, 
        influence: 2, 
        ongoingAgendas: [
          {name: 'high bounty',  target: 'biv bodhrik'},
          {name: 'no escape', target: 'Garkan'}, 
          {name: 'All Too Easy', target: 'Diala Pasil'}
        ]
      }
    )
  );
}

export default App;
